var data_cluster = {}
var interval;
document.getElementById('clusterForm').addEventListener('submit', function (e) {
  e.preventDefault();
  document.getElementById('loadingProgress').style.display = 'block';
  document.getElementById('progressBar').style.width = '0%';
  const folderName = document.getElementById('folderNameCluster').value;
  console.log(folderName);
  fetch('http://localhost:5000//get_number_of_images', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({ fname: folderName })
  })
    .then(response => response.json())
    .then(data => {
      console.log(data);
      alert(`Nombre d'images: ${parseInt(data["number_of_images"])}`)
      updateProgressBar(parseInt(data["number_of_images"]) * 1000);
      findClusters(folderName);
    })
    .catch(error => console.error('Error:', error));
});

document.getElementById('searchForm').addEventListener('submit', function (e) {
  e.preventDefault();
  const folderName = document.getElementById('folderNameSearch').value;
  const searchQuery = document.getElementById('personName').value;
  console.log(folderName);
  console.log(searchQuery);
  getExif(folderName, searchQuery);
});

function findClusters(folderName) {
  fetch('http://localhost:5000/find_clusters', {
      method: 'POST',
      headers: {
          'Content-Type': 'application/json'
      },
      body: JSON.stringify({ fname: folderName })
  })
  .then(response => response.json())
  .then(data => {
      displayClusterResults(data_cluster = data);
      document.getElementById('progressBar').style.width = '100%'; // Complete progress bar
      setTimeout(() => { 
          document.getElementById('loadingProgress').style.display = 'none';
      }, 500); // Hide progress bar after a short delay
      clearInterval(interval);
  })
  .catch(error => {
      console.error('Error:', error);
      document.getElementById('progressBar').style.width = '100%'; // Complete progress bar
      setTimeout(() => { 
          document.getElementById('loadingProgress').style.display = 'none';
      }, 500); // Hide progress bar after a short delay
      clearInterval(interval);
  });

}

function changeExif() {
  let exifData = {};

  let clusterContainers = document.getElementsByClassName('cluster-div');
  for (let i = 0; i < clusterContainers.length; i++) {
    let clusterContainer = clusterContainers[i];
    let personName = clusterContainer.querySelector('input').value;

    exifData[i] = {
      name: personName,
      paths: data_cluster[i]["paths"]
    };
  }
  console.log(exifData);

  fetch('http://localhost:5000/change_exif', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(exifData)
  })
    .then(response => response.json())
    .then(data => {
      console.log(data);
      alert(`Noms ajoutés avec succès!`);
    })
    .catch(error => console.error('Error:', error));
}

function getExif(folderName, face_name) {
  fetch('http://localhost:5000/get_image_by_face', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({ fname: folderName, face_name: face_name })
  })
    .then(response => response.json())
    .then(data => displaySearchResults(data))
    .catch(error => console.error('Error:', error));
}

function openTab(evt, tabName) {
  var i, tabcontent, tabbuttons;
  tabcontent = document.getElementsByClassName("tab-content");
  for (i = 0; i < tabcontent.length; i++) {
    tabcontent[i].style.display = "none";
  }

  tabbuttons = document.getElementsByClassName("tab-button");
  for (i = 0; i < tabbuttons.length; i++) {
    tabbuttons[i].className = tabbuttons[i].className.replace(" active", "");
  }

  document.getElementById(tabName).style.display = "block";
  evt.currentTarget.className += " active";
}

function displayClusterResults(data) {
  let resultsContainer = document.getElementById('clusterResults');
  resultsContainer.innerHTML = '';
  resultsContainer.innerHTML = `<h2 class="title"> ${Object.keys(data).length} personnes trouvées </h2>`;
  resultsContainer.innerHTML += `<button class="button" onclick="changeExif()">Ajouter les informations aux images (laissez vide si erreur)</button>`;

  let clustersContainer = document.createElement('div');
  clustersContainer.classList.add('clusters-container');
  Object.keys(data).forEach((cluster, index) => {

    let clusterDiv = document.createElement('div');
    clusterDiv.classList.add('cluster-div');

    let nameDiv = document.createElement('div');
    nameDiv.classList.add('bottom-div');

    let imagesContainer = document.createElement('div');
    imagesContainer.classList.add('images-container');
    imagesContainer.classList.add('top-div');

    nameDiv.innerHTML = `<h3>${parseInt(cluster) + 1}e personne</h3>`;
    nameDiv.innerHTML += `<input type="text" id="personName${cluster}" class="styled-input" placeholder="Entrez le nom de la personne">`;


    data[cluster]["faces"].forEach(image => {
      imagesContainer.innerHTML += `
                    <img src="data:image/jpeg;base64,${image}" class="responsive-image">
            `;
    });

    clusterDiv.appendChild(nameDiv);
    clusterDiv.appendChild(imagesContainer);
    clustersContainer.appendChild(clusterDiv);
  });
  resultsContainer.appendChild(clustersContainer);

}

function displaySearchResults(data) {
  let resultsContainer = document.getElementById('searchResults');
  resultsContainer.innerHTML = '';
  data.forEach(image => {
    resultsContainer.innerHTML += ` <a href="${image}" target="_blank">
                                      <img src="file:///${image}" alt="${image}" class="responsive-image-search">
                                      </a>
                                  `;
  });
}


function updateProgressBar(estimatedTime) {
  if (document.getElementById('progressBar') != null) {
    const updateInterval = 1000; // Update every 100 milliseconds
    let elapsedTime = 0;

    interval = setInterval(function () {
      if (document.getElementById('progressBar') == null) {
        clearInterval(interval);
        return;
      }
      elapsedTime += updateInterval;
      const progressPercentage = Math.min((elapsedTime / estimatedTime) * 100, 100);
      document.getElementById('progressBar').style.width = progressPercentage + '%';

      if (elapsedTime >= estimatedTime) {
        clearInterval(interval);
      }
    }, updateInterval);
  }
}
